import {
  Card,
  CardActions,
  CardContent,
  CardMedia,
  Button,
  Typography,
  Avatar,
  Grid,
} from "@mui/material";
import { Box } from "@mui/system";
import axios from "axios";

import React, { Fragment, useEffect, useState } from "react";
import SocialLinks from "./SocialLinks";

const ReactionChannels = () => {
  const [channelData, setChannelData] = useState([]);

  useEffect(async () => {
    const res = await axios.get("/promoter/reactionchannel/all");
    setChannelData(res.data);
  }, []);

  return (
    channelData !== null && (
      <Fragment>
        <div className="container">
          <Grid container spacing={2}>
            {channelData.map((currChannel) => (
              <Grid item xs={12} sm={4}>
                <Card sx={{ maxWidth: 345 }}>
                  <Typography gutterBottom variant="h5" component="div">
                    {currChannel.name}
                  </Typography>
                  <CardMedia
                    component="img"
                    height="140"
                    // image={
                    //   require(`../../../resources/artist/images/page/${currChannel.profileImage}`)
                    //     .default
                    // }
                    alt="green iguana"
                  />
                  <CardContent>
                    <Typography gutterBottom variant="h5" component="div">
                      Lizard
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      {currChannel.originalName}
                    </Typography>
                  </CardContent>
                  <CardActions>
                    <SocialLinks linksData={currChannel.sociallinks} />
                  </CardActions>
                </Card>
              </Grid>
            ))}
          </Grid>
        </div>
      </Fragment>
    )
  );
};

export default ReactionChannels;
